Star magazine is a weekly magazine published for the true gossip guru. With an editorial team on the heels of the entertainment stars you love, Star magazine is sure to satisfy all of your cravings for the best, most exclusive celebrity gossip and news. Weekly sections include &quot;Knifestyles of the Rich and Famous,&quot; which features analyses of the latest celebs to undergo plastic surgery, and &quot;Worst of the Week,&quot; where you'll find amusing fashion disasters of the previous week. Star magazine also provides a ton of fashion photos of the most beautiful, style-worthy stars, along with newsworthy articles, interviews, horoscopes and more. Whether you love keeping up with today's hottest celebrities or are simply entertained by the lifestyle, Star magazine proves that when it comes to the rich and the famous, there's never a dull moment.

